export default class AjouterRecette extends Component {
  state = {
    nom: "",
    image: "",
    ingredients: "",
    instructions: ""
  };
  render() {
    return (
      <div className="card">
        <h1>Ajouter Recette</h1>
      </div>
    );
  }
}
